Nije moguće pokrenuti testiranje svetala na prikolici.

Proverite sledeće i pokušajte ponovo:
– vozilo je u parkirnom položaju;
– kočnica nije aktivirana;
– svetla upozorenja su isključena;
– pokazivači pravca su isključeni.

